import React from 'react';
import './Gallery.css'

const images = [""];

class Gallery extends React.Component {
    getImage() {
        return <span>{images}<br/></span>
    }

    render() {
        return(
          <div className="page-container">
              <header className="gallery-header">Gallery</header>
              <div className="gallery-container">
                  <div className="box">
                      <div className="imgBox">
                          <img src="pump_bracket.jpg" alt="Unloaded Image"/>
                      </div>
                  </div>
                  <div className="box"></div>
                  <div className="box"></div>
                  <div className="box"></div>
                  <div className="box"></div>
                  <div className="box"></div>
                  <div className="box"></div>
                  <div className="box"></div>
                  <div className="box"></div>
              </div>
          </div>
        )
    }
}

export default Gallery
